import { OrderedListOutlined, ProfileOutlined } from "@ant-design/icons";
import { Col, Drawer } from "antd";

export const SideBar = () => {
  return (
    <div>
      <aside style={{}}>
        <Drawer
          placement={"left"}
          closable={false}
          open={true}
          style={{
            position: "absolute",
            left:'5%',
            height: "100%",
            width: "60px",
            borderRadius: "50px 50px",
          }}
        >
            <Col>
            <OrderedListOutlined/>
            <ProfileOutlined/>
            </Col>
        </Drawer>
      </aside>
    </div>
  );
};
